    "seney-wildlife-refuge-narrative-report-of-activities-for-period-august-1-to-october-31-193",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Seney National
    Wildlife Refuge outlines Refuge accomplishments from August through October of 1938.
    The report begins by summarizing the weather conditions and food and cover during
    this period. Wildlife- including migratory birds, upland game birds, predators,
    rodents, raptors, and reptiles- is also covered. The Refuge development and maintenance
    section discusses physical developments, plantings, and collections and receipts.
    Resource management is outlined; topics include fur harvesting. A progress report
    on field investigations and applied research is also provided. The public relations
    section of the report describes recreational uses and violations. N-R forms and
    photographs are attached.",nt"license_title": "License Not Specified",nt"extras":
